import React, { useEffect } from "react";


const Explorer = props =>{
    useEffect(()=>{
        document.body.classList.add("orange");
        return () => {
            document.body.classList.remove("oragne");
        }
    })
    return (
        <div className="expolor">
            <h4>Explorer</h4>
        </div>
    )
}

export default Explorer
